import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import store from "./redux/store"
//import Pretendard from './fonts/Pretendard.ttf'
import aaa from './fonts/HSGyeoulNoonkott2.0-Regular.ttf'

import { Provider } from 'react-redux';

import { MuiThemeProvider, createTheme } from '@material-ui/core/styles';

// const theme = createTheme({
//   typography: {
//     fontFamily: 'Pretendard',
//   },
//   components: {
//     MuiCssBaseline: {
//       styleOverrides: `
//       @font-face { 
//         font-family: 'Pretendard'; 
//         src: local('Pretendard'), local('Pretendard'), url(${Pretendard} format('ttf))
//       }
//     `,
//     },
//   },
// });

const theme = createTheme({
  typography: {
    fontFamily: 'HSGyeoulNoonkott2.0-Regular',
  },
  components: {
    MuiCssBaseline: {
      styleOverrides: `
      @font-face { 
        font-family: 'HSGyeoulNoonkott2.0-Regular'; 
        src: local('HSGyeoulNoonkott2.0-Regular'), local('HSGyeoulNoonkott2.0-Regular'), url(${aaa} format('ttf))
      }
    `,
    },
  },
});

ReactDOM.render(
  <React.StrictMode>
    <MuiThemeProvider theme={theme}>
      <Provider store={store}>
      <App />
      </Provider>
    </MuiThemeProvider>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
